import React, { Component } from 'react';
import ReactDOM, {
  BrowserRouter as Router,
  Link,
  Route,
  Switch,
} from 'react-dom';

class Header extends Component {
  render() {
    return (
      <header className="header">
        <div className="logo">
          <h1>Mark Fasel</h1>
        </div>
        <ul className="navigation">
          <Link to="">About</Link>
        </ul>
      </header>
    );
  }
};

export default Header;
